import styled from "styled-components";
import { Link } from "react-router-dom";


export default function Nav() {
  return (
    <NavBarStyle>
      <Link to="/" className="linknav">Home</Link>
      <Link to="/countries" className="linknav">Ver paises</Link>
      <Link to="/activities" className="linknav">Actividades</Link>
      <Link to="/contact" className="linknav">Contacto</Link>
    </NavBarStyle>
  )
}

const NavBarStyle = styled.div`
  display: flex;
  justify-content: space-around;
  border-top: .1rem solid #000000;
  //        ↑ ancho, tipo, color ↑
  padding: 2rem 0;
  max-width: 120rem;
  margin: 0 auto;
  /* transition: all .8s; */
  position: relative;
  font-weight: bold;

  
`;
